// import styles
import "./style.min.css";

export const Button1 = ({ text, to }) => (
  <button className="button button1">
    <a href={to} target="_blank" alt={`${text}`}>
      {text}
    </a>
  </button>
);

export const Button2 = ({ text, to }) => (
  <button className="button button2">
    <a href={to} target="_blank" alt={`${text}`}>
      {text}
    </a>
  </button>
);

export const Button3 = ({ disabled = true, error, onMouseOver, text }) => (
  <>
    <button
      className={`button  ${disabled ? "button3-disabled" : "button3"}`}
      disabled={disabled}
      onMouseOver={onMouseOver}
    >
      {text}
    </button>
    {<p className="button-error">{error}</p>}
  </>
);
